INSERT INTO `about` (`about_id`, `mission`, `mission_image_1`, `mission_image_2`, `mission_image_3`, `vision`, `vision_image_1`, `vision_image_2`, `vision_image_3`, `history`) VALUES
(1, 'To acquire a strong impact on the public, the Makati City Library provides total quality services, through fast and efficient access to information that builds positive insights, attitudes and values, helping clientele develop into informed, free and peace-loving citizens. ', 'mission_1_20241015_111901.jpg', 'mission_2_20241015_111901.jpg', 'mission_3_20241015_111901.jpg', 'The Makati City Library envisions a transformed socio-economic, political and cultural structure through continuous education of the citizens and by serving as an impartial, non-partisan and non-sectarian agency for all people.', 'vision_1_20241015_111901.jpg', 'vision_2_20241015_111901.jpg', 'vision_3_20241015_111901.jpg', 'The Makati City Library originated as the Makati Public Library. It was organized in 1954 by the Makati Women\'s Civic League, whose advisers were the late Mrs, Dolores Marcelo Rivera (ex-councilor) and the late Mrs. Mercedes Samson as President.<br><br>\r\n\r\nThe library was turned over to the Municipal Govemment shortly after its opening. The former Miss Veronidia Gutierrez Garcia now Mrs. Veronidia Garcia Garcia, was appointed library custodian. The library was located in a small room at the back of the Makati Fire Department. It had spare furniture consisting of a long plywood table, two long benches, an office table for the librarian and bookshelves enough to contain the 300 volumes of books which the library acquired as initial stock from the Bureau of Public Libraries, now The National Library. Another 500 volumes of books were later acquired from the defunct House of Representative at the instance of Mrs. Dolores Marcelo Rivera. Some civic spirited citizens subscribed to two newspapers for the library. An average of 100 persons used to come daily to the library in spite of the sparsity of reading materials, most of them, students and out-of-school youths. As the years passed, some changes in the library took place. But these were mostly insignificant because of a new Mayor, new personnel managed the library and its location was also changed.<br><br>\r\n\r\nIn 1963, the library was moved to the 4th floor of the new Municipal Building during the term of the late Mayor Maximo Estrella. The mayor launched a program upgrading all departments of the Municipal Govemment and the library began an important phase of development with the upgrading facilities including the purchased of new books. When typhoon Yoling partially destroyed the building in 1967, the library was moved to the 2dn floor of the old municipal building.<br><br>\r\n\r\nWhen the late Mayor Nemesio I. Yabut assumed office in 1972, one of his first moves was the relocation of the library to the second floor of the Essale Building at J. P. Rizal Avenue corner Makati Avenue.<br><br>\r\n\r\nIn 1975, the library was able to have a Bookmobile library donated by the USAID. The Bookmobile was the first of its kind in Metro Manila. It was able to serve different schools and some far barrios of Makati. In the latter part of 1981, the bookmobile unit had mechanical trouble forcing the library staff to stop operations.<br><br>\r\nIn time for the 1984 - 1985 school year, the Ayala Corporation on the occasion of its 150th Anniversary, donated 749 books on different subjects and on different school levels. The repair of the office equipment were also paid by the Ayala Corporation.\r\n\r\n');
